import React, { Component } from 'react';

import Toolbar from '../../components/Navigation/Toolbar/Toolbar';
import NavigationItems from '../../components/Navigation/NavigationItems/NavigationItems';
import { Grid, Navbar, NavItem, Row, Col } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

class Layout extends Component {
    render() {
        return (
            <Navbar default collapseOnSelect>
            <Navbar.Header>
              {/* <Navbar.Brand>
                <Link to="/">CodeLife</Link>
              </Navbar.Brand> */}
              <Navbar.Toggle />
            </Navbar.Header>
            <Navbar.Collapse>
              <Nav pullRight>
                <NavItem eventKey={1} componentClass={NavLink} href="/" to="/">
                  Home
                </NavItem>
                <NavItem eventKey={2} componentClass={NavLink} href="/about" to="/about">
                  About
                </NavItem>
                <NavItem eventKey={3} componentClass={NavLink} href="/news" to="/news">
                  News
                </NavItem>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
        )
    }
}

export default Layout;
